import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import "./HeroSection.css";
import heroImage from "../../images/main.jpg";

const HeroSection = () => {
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    const img = new Image();
    img.src = heroImage;
    img.onload = () => setIsLoaded(true);
  }, []);

  return (
    <section className={`premium-hero ${isLoaded ? "loaded" : ""}`}>
      {/* Фоновое изображение с lazy load */}
      <div
        className="premium-hero-bg"
        style={{ backgroundImage: isLoaded ? `url(${heroImage})` : "none" }}
      />

      {/* Основной контент */}
      <div className="premium-content">
        <motion.div
          initial={{ opacity: 0, y: 40 }}
          animate={isLoaded ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 1 }}
          className="premium-text-block"
        >
          <div className="premium-badge">Эксклюзив</div>
          <h1 className="premium-title">
            <span>Теплые резиденции</span>
            <span className="premium-title-accent">премиум-класса</span>
          </h1>
          <p className="premium-subtitle">
            Строительство элитных энергоэффективных домов
            <br />с гарантией 15 лет по европейским стандартам
          </p>
        </motion.div>

        {/* Кнопка CTA */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={isLoaded ? { opacity: 1 } : {}}
          transition={{ delay: 0.3, duration: 0.8 }}
          className="premium-cta-block"
        >
          <button className="premium-cta-btn">
            <span>Запросить презентацию</span>
            <div className="premium-cta-hover"></div>
          </button>
          <div className="premium-cta-note">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none">
              <path
                d="M12 22C17.5228 22 22 17.5228 22 12C22 6.47715 17.5228 2 12 2C6.47715 2 2 6.47715 2 12C2 17.5228 6.47715 22 12 22Z"
                stroke="currentColor"
                strokeWidth="2"
              />
              <path
                d="M12 8V12L15 15"
                stroke="currentColor"
                strokeWidth="2"
                strokeLinecap="round"
              />
            </svg>
            Ответ в течение 24 часов
          </div>
        </motion.div>
      </div>

      {/* Социальные доказательства */}
      <motion.div
        className="premium-social-proof"
        initial={{ opacity: 0 }}
        animate={isLoaded ? { opacity: 1 } : {}}
        transition={{ delay: 0.6, duration: 0.8 }}
      >
        <div className="premium-proof-item">
          <div className="premium-proof-number">42+</div>
          <div className="premium-proof-label">Реализованных проекта</div>
        </div>
        <div className="premium-proof-item">
          <div className="premium-proof-number">15</div>
          <div className="premium-proof-label">Лет гарантии</div>
        </div>
      </motion.div>

      {/* Декоративный элемент */}
      <div className="premium-decoration">
        <div className="premium-decoration-line"></div>
        <div className="premium-decoration-text">С 2012 года на рынке</div>
      </div>
    </section>
  );
};

export default HeroSection;
